import React from "react";

let loggedIn=true;
function renderingCondition(){
  if (loggedIn){
    return (
      <h1>Hello</h1>
    )

  }
  else{
    return(

      <form className="form">
        <input type="text" placeholder="Username" />
        <input type="password" placeholder="Password" />
        <button type="submit">Login</button>
      </form>
    )
  }
}

function App() {
  return (
    <div className="container">
    {renderingCondition}
    </div>
  );
}

export default App;
